import { combineReducers } from 'redux';
import { drizzleReducers } from '@drizzle/store';
import {appReducers} from './transactionReducer';

//const ogrerun =  ... drizzleReducers;

export default combineReducers({
  appReducers,
  ogreducer: {... drizzleReducers}
})

